import Link from 'next/link';

export default function Index() {
    return (
        <div>
            <h1>Hello!</h1>
            <img src="/static/Cara.png" alt="Cara image"/>
            <Link href="/about">
                <a>About</a>
            </Link>
            <Link href="/projects">
                <a>Projects</a>
            </Link>
            <Link href="/contact">
                <a>Contact</a>
            </Link>

    <style jsx>{`
        div {
            background-color: azure;
            border: solid;
            text-align: center;
        }
        img {
            height: auto;
            width: 10%;
        }
        a {
            border: solid;
            margin-left: 5px;
            margin-top: 10px;
        }
    `}</style>
        </div>
    );
}
